		SlideShowPlayerAPI.prototype.RenderedToBuffer = function (eventArgs) {

			if (this.m_handshakeFinished)

		SlideShowPlayerAPI.prototype.RecordQosError = function (eventArgs) {
			var _this = this;
			if (eventArgs.errorName == "ContentFallBack") {

			if (eventArgs.additionalValues != null && eventArgs.additionalValues["Elapse"] != null) {

				m_id: this.m_id, m_type: SlideShowPlayerExternalMessageType.RecordQosError, m_errorName: eventArgs.errorName, m_vetoName: eventArgs.vetoName, m_isIntentional: eventArgs.isIntentional, m_isInternal: eventArgs.isInternal,
				m_alertOnPillar: eventArgs.alertOnPillar, m_isSessionEndingError: eventArgs.isSessionEndingError, m_durationMs: durationMs
			};
			if (this.m_handshakeFinished)
				this.PostMessageUpward(msg);
			else
				this.m_queuedOnHandshakeFinished.push(function () { _this.PostMessageUpward(msg); });
		};
		SlideShowPlayerAPI.prototype.PostFailureUpwards = function (eventArgs) {

		SlideShowPlayerAPI.prototype.FinishHandshake = function () {
			this.m_logger.ULS.traceTag(0x02494448, logCategory.PptNavigation, logLevel.Info, "PowerPoint ready for host session:" + this.m_app.get_HostSessionId());
			var handShake = {
				m_id: this.m_id,
				m_type: SlideShowPlayerExternalMessageType.Handshake,
				m_sessionId: this.m_app.get_SessionId(),
				m_percievedBootTime: PPTe.BootTiming.GetBootTimingDataPoint("PreviewDisplayed") || PPTe.BootTiming.GetBootTimingDataPoint("LaunchSlideFinish")
			};
			this.PostMessageUpward(handShake);
			this.m_handshakeFinished = true;
			this.m_queuedOnHandshakeFinished.forEach(function (e) { e(); });
			this.m_queuedOnHandshakeFinished = [];
		};
		SlideShowPlayerAPI.prototype.OnMessage = function (domEvent) {
			var _this = this;
			if (domEvent.source != window.parent) {
				return;
			}
			var data;
			try {
				data = JSON.parse(domEvent.data);
			}
			catch (Exception) {
				return;
			}
			if (data == null || data.m_type == null) {
				return;
			}
			window.setTimeout(function () { _this.HandleMessage(data); }, 1);
		};

		SlideShowPlayerAPI.prototype.PostMessageUpward = function (message) {
			if (message.m_id != null) {
				var data = JSON.stringify(message);
				window.parent.postMessage(data, this.m_parentWindowOrigin);
			}
			else {
				this.m_logger.ULS.traceTag(0x031108df, logCategory.PptSession, logLevel.Error, "PostMessage called without id or target!");
			}
		};
		SlideShowPlayerAPI.prototype.HandleHandshakeMessage = function (handshakeMessage) {
			if (this.m_handshakeReceived) {
				if (this.m_logger)
					this.m_logger.ULS.traceTag(0x226d7685, logCategory.PptSession, logLevel.Error, "Duplicate HandshakeMessage received: " + this.m_id + ", handshakeMessage:" + handshakeMessage);
				return;
			}
			this.m_handshakeReceived = true;
			if (this.m_logger) {
				this.m_logger.ULS.traceTag(0x226d7684, logCategory.PptSession, this.m_id == handshakeMessage.m_id ? logLevel.Info : logLevel.Error, "HandleHandshakeMessage: m_id:" + this.m_id + ", handshakeMessage.m_id:" + handshakeMessage.m_id);
			}
			if (handshakeMessage.m_id && handshakeMessage.m_fEnableKeyboardNavigation != null) {
				PPTe.BootTiming.RecordBootTiming("ReceivedHandshakeFromAPI", new Date().getTime(), null);
				this.m_id = handshakeMessage.m_id;
				if (this.m_app) {
					this.m_app.get_SessionActivity().RecordHandshakeData(handshakeMessage);
					this.m_app.SetEnableKeyboardNavigation(handshakeMessage.m_fEnableKeyboardNavigation);
					this.m_app.OnRecievedContentMetadataFromApi(handshakeMessage.m_contentMetadata);
					this.m_app.set_FAdvanceOnTap(handshakeMessage.m_fEnableAdvanceOnTap);
					this.m_handshakeConditional.SetCondition(this.c_handshakeStartedCondition);
					this.m_app.setDisabledTransitions(handshakeMessage.m_disabledTransitionsList);
					this.m_app.setCustomTransitionResourceUrl(handshakeMessage.m_customTransitionResourceUrl);
					this.m_app.setStreamUseThinEmbed(handshakeMessage.m_streamUseThinEmbed);
					this.m_app.setAreThirdPartyAddInsAllowed(handshakeMessage.m_areThirdPartyAddInsAllowed);
					this.m_app.setAllowExternalMarketplace(handshakeMessage.m_allowExternalMarketplace);
				}
				for (var iQueuedError = 0; iQueuedError < this.m_queuedErrors.length; ++iQueuedError) {
					var errorContents = this.m_queuedErrors[iQueuedError];
					this.SendError(errorContents.Code, errorContents.ErrorName, errorContents.Message, errorContents.ExtraInfo, errorContents.CorrelationId);
				}
				if (!this.m_app)
					return;
				var vetoAppSettingsStr = handshakeMessage.m_vetoAppSettingsStr || "";
				this.m_app.OnApiReady(handshakeMessage.m_fileUrl, handshakeMessage.m_fileSize, handshakeMessage.m_fileName, handshakeMessage.m_presentationId, handshakeMessage.m_startingSlideId, handshakeMessage.m_startingSlideIndex, vetoAppSettingsStr, handshakeMessage.m_disabledChangeGates);
				if (this.FStartPreview(handshakeMessage.m_startingSlideIndex)) {
					this.StartPreview(handshakeMessage.m_presentationId, handshakeMessage.m_startingSlideIndex);
				}
			}
			else {
				this.m_logger.ULS.traceTag(0x0258e448, logCategory.PptSession, logLevel.Error, "Invalid HandshakeMessage received");
			}
		};

		SlideShowPlayerAPI.prototype.HandleMessage = function (data) {
			this.m_logger.ULS.traceTag(0x23517692, logCategory.PptSession, logLevel.Info, "Received Message for API :" + data.m_type);
			this.m_lastOnPositionChangedMessageDuringHandleMessage = null;
			this.m_fHandlingInternalMessage = true;
			switch (data.m_type) {
				case SlideShowPlayerInternalMessageType.Handshake:
					{
						var handshakeMessage = data;
						this.HandleHandshakeMessage(handshakeMessage);
						break;
					}
				case SlideShowPlayerInternalMessageType.GetSlidesInShowCount:
					{
						var getSlidesInShowCountResponse = { m_id: this.m_id, m_type: SlideShowPlayerExternalMessageType.GetSlidesInShowCount, m_slidesCount: this.m_app.GetSlidesInShowCount() };
						this.PostMessageUpward(getSlidesInShowCountResponse);
						break;
					}
				case SlideShowPlayerInternalMessageType.GetTimeLineInfos:
					{
						var getBuildStepsCountWebViewerInternalMessage = data;
						this.HandleGetTimelineInfosMessage(getBuildStepsCountWebViewerInternalMessage);
						break;
					}
				case SlideShowPlayerInternalMessageType.GetCurrentPosition:
					{
						this.HandleGetCurrentPositionMessage();
						break;
					}
				case SlideShowPlayerInternalMessageType.GetCurrentPositionWithTimeLines:
					{
						this.HandleGetCurrentPositionWithTimeLinesMessage();
						break;
					}
				case SlideShowPlayerInternalMessageType.GetId:
					{
						var getIdWebViewerInternalMessage = data;
						this.HandleGetIdMessage(getIdWebViewerInternalMessage);
						break;
					}
				case SlideShowPlayerInternalMessageType.Next:
					{
						var nextData = data;
						this.m_app.ObjectModelNextStep(nextData.m_metadata);
						break;
					}
				case SlideShowPlayerInternalMessageType.PausePresentation:
					{
						this.m_app.ObjectModelPausePresentation();
						break;
					}
				case SlideShowPlayerInternalMessageType.PlayPresentation:
					{
						this.m_app.ObjectModelPlayPresentation();
						break;
					}
				case SlideShowPlayerInternalMessageType.GetPresentationPlaybackState:
					{
						var getPresentationPlaybackStateResponse = { m_id: this.m_id, m_type: SlideShowPlayerExternalMessageType.GetPresentationPlaybackState, m_playbackState: this.m_app.GetPresentationPlaybackState() };
						this.PostMessageUpward(getPresentationPlaybackStateResponse);
						break;
					}
				case SlideShowPlayerInternalMessageType.NextSlide:
					{
						this.m_app.ObjectModelNextSlide();
						break;
					}
				case SlideShowPlayerInternalMessageType.Prev:
					{
						var prevData = data;
						this.m_app.ObjectModelPrevStep(prevData.m_metadata);
						break;
					}
				case SlideShowPlayerInternalMessageType.PrevSlide:
					{
						this.m_app.ObjectModelPrevSlide();
						break;
					}
				case SlideShowPlayerInternalMessageType.GoToPrevSlide:
					{
						this.m_app.ObjectModelGoToPrevSlide();
						break;
					}
				case SlideShowPlayerInternalMessageType.GoToNextSlide:
					{
						this.m_app.ObjectModelGoToNextSlide();
						break;
					}
				case SlideShowPlayerInternalMessageType.GoToSlide:
					{
						var goToSlideWebViewerInternalMessage = data;
						this.HandleGoToSlideMessage(goToSlideWebViewerInternalMessage);
						break;
					}
				case SlideShowPlayerInternalMessageType.GoToSlideId:
					{
						var goToSlideIdWebViewerInternalMessage = data;
						if (isUintValid(goToSlideIdWebViewerInternalMessage.m_slideId) && goToSlideIdWebViewerInternalMessage.m_timeLineMappings != null) {
							this.m_app.ObjectModelGoTo(this.m_app.GetSlideIdFromString(goToSlideIdWebViewerInternalMessage.m_slideId.toString()), goToSlideIdWebViewerInternalMessage.m_timeLineMappings, {});
						}
						break;
					}
				case SlideShowPlayerInternalMessageType.PlayMedia:
					{
						var playMediaInternMessage = data;
						this.m_logger.ULS.traceTag(0x223d7023, logCategory.PptSession, logLevel.Info, "Received PlayMedia Message for media: " + playMediaInternMessage.m_mediaPlayerName);
						this.m_app.ObjectModelPlayMedia(playMediaInternMessage.m_mediaPlayerName);
						break;
					}
				case SlideShowPlayerInternalMessageType.PauseMedia:
					{
						var pauseMediaInternMessage = data;
						this.m_logger.ULS.traceTag(0x223d7040, logCategory.PptSession, logLevel.Info, "Received PauseMedia Message for media: " + pauseMediaInternMessage.m_mediaPlayerName);
						this.m_app.ObjectModelPauseMedia(pauseMediaInternMessage.m_mediaPlayerName);
						break;
					}
				case SlideShowPlayerInternalMessageType.RestoreFocus:
					{
						this.m_app.RestoreFocus();
						break;
					}
				case SlideShowPlayerInternalMessageType.StopMedia:
					{
						var stopMediaInternMessage = data;
						this.m_app.ObjectModelStopMedia(stopMediaInternMessage.m_mediaPlayerName);
						break;
					}
				case SlideShowPlayerInternalMessageType.SeekMedia:
					{
						var seekMediaInternMessage = data;
						this.m_logger.ULS.traceTag(0x223d7041, logCategory.PptSession, logLevel.Info, "Received SeekMedia Message for media: " + seekMediaInternMessage.m_mediaPlayerName + ", position: " + seekMediaInternMessage.m_position);
						this.m_app.ObjectModelSeekMedia(seekMediaInternMessage.m_mediaPlayerName, seekMediaInternMessage.m_position);
						break;
					}
				case SlideShowPlayerInternalMessageType.GetCurrentMediaStates:
					{
						var state = this.m_app.ObjectModelGetCurrentMediaStates();
						if (state.slideId == null) {
							state.slideId = this.m_invalidSlideId;
						}
						var getCurrentMediaStatesResponse = { m_id: this.m_id, m_type: SlideShowPlayerExternalMessageType.GetCurrentMediaStates, m_slideId: state.slideId.get_Id(), m_slideIndex: state.slideIndex, m_mediaStates: state.mediaStates };
						this.PostMessageUpward(getCurrentMediaStatesResponse);
						break;
					}
				case SlideShowPlayerInternalMessageType.GetCurrentSlideDimensions:
					{
						this.HandleGetCurrentSlideDimensionsMessage();
						break;
					}
				case SlideShowPlayerInternalMessageType.BootTimingFromApi:
					{
						PPTe.BootTiming.RecordBootTiming("ReceivedBootTimingDataFromApi", new Date().getTime(), null);
						var bootTimingFromApiInternalMessage = data;
						PPTe.BootTiming.BulkAddTimingsFromApi(bootTimingFromApiInternalMessage.m_apiTimings);
						break;
					}
				case SlideShowPlayerInternalMessageType.GenericULSLog:
					{
						PPTe.BootTiming.RecordBootTiming("ReceivedHostPageDomainFromApi", new Date().getTime(), null);
						var genericULSLogInternalMessage = data;
						this.m_logger.ULS.traceTag(genericULSLogInternalMessage.m_tagID, logCategory.PptSession, logLevel.Info, genericULSLogInternalMessage.m_message);
						break;
					}
				case SlideShowPlayerInternalMessageType.ExitSlideshow:
					{
						this.m_app.ExitChromelessSlideshow();
						break;
					}
				case SlideShowPlayerInternalMessageType.RefreshPodSession:
					{
						var msg = data;
						this.m_app.RefreshPodSession(msg.m_podSessionId, msg.m_wacCluster);
						break;
					}
				case SlideShowPlayerInternalMessageType.SetNavigationOptions:
					{
						var navMsg = data;
						this.m_app.set_FAdvanceOnClick(navMsg.m_enableAdvanceOnClick);
						this.m_app.SetEnableKeyboardNavigation(navMsg.m_enableKeyboardNavigation);
						break;
					}
				case SlideShowPlayerInternalMessageType.ShowHideCursor:
					{
						var showHideCursorInternalMessage = data;
						this.m_app.ObjectModelShowHideCursor(showHideCursorInternalMessage.m_fShow);
						break;
					}
				case SlideShowPlayerInternalMessageType.RecordStartedSlideShowTimestamp:
					{
						var recordStartedSlideShowTimestampInternalMessage = data;
						this.m_app.RecordStartedSlideShowTimestamp(recordStartedSlideShowTimestampInternalMessage.m_startSlideShowTime);
						break;
					}
				case SlideShowPlayerInternalMessageType.RecordMetrics:
					{
						var recordMetricsMessage = data;
						if (recordMetricsMessage.m_statName === "TeamsNavMetric") {
							PPTe.AppSessionTeamsLoggingHelper.TrackTeamsPVMetrics(recordMetricsMessage.m_data, this.m_app.get_SessionUTC());
						}
						if (this.m_fResumeSlideShowEnabled || this.m_fSlideShowToolbarEnabledForAttendee || this.m_fSlideShowToolbarEnabledForPresenter) {
							var action = recordMetricsMessage.m_data["action"];
							if (action) {
								var c_enterPrivateViewing = 'enterPrivateViewing';
								var c_leavePrivateViewing = 'leavePrivateViewing';
								switch (action) {
									case c_enterPrivateViewing: {
										this.m_app.SwitchRole(PPTe.SlideShowRole.PrivateViewing);
										break;
									}
									case c_leavePrivateViewing: {
										this.m_app.SwitchRole(PPTe.SlideShowRole.Attendee);
										break;
									}
									default:
										{
											break;
										}
								}
							}
						}
						break;
					}
				case SlideShowPlayerInternalMessageType.SwitchRoleV2:
					{
						var switchRoleMessage = data;
						this.m_app.SwitchRole(switchRoleMessage.m_role);
						break;
					}
				case SlideShowPlayerInternalMessageType.SetPrivateViewingToggle:
					{
						var setTogglePrivateViewingMessage = data;
						this.m_app.SetPrivateViewingToggle(setTogglePrivateViewingMessage.m_enabled);
						break;
					}
				case SlideShowPlayerInternalMessageType.SendPresenterStateDuringPrivateViewing:
					{
						var presenterStateMessage = data;
						this.m_app.SendPresenterStateDuringPrivateViewing(presenterStateMessage.m_slideIndex, presenterStateMessage.m_timeLineMappings, presenterStateMessage.m_metadata);
						break;
					}
				case SlideShowPlayerInternalMessageType.ChangeTheme:
					{
						var changeThemeMessage = data;
						this.m_app.ChangeTheme(changeThemeMessage.m_isHighContrast, changeThemeMessage.m_highContrastColorSettings);
						break;
					}
				default:
					{
						break;
					}
			}
			this.m_fHandlingInternalMessage = false;
			if (this.m_lastOnPositionChangedMessageDuringHandleMessage != null) {
				this.PostMessageUpward(this.m_lastOnPositionChangedMessageDuringHandleMessage);
				this.m_lastOnPositionChangedMessageDuringHandleMessage = null;
